import React,{useState} from 'react'
import { Box, Typography, Grid, Paper,MenuItem } from '@mui/material'
import HelpOutlinedIcon from '@mui/icons-material/HelpOutlined';
import { useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom'

export const EditAccount = ({ contacts, updateContact }) => {

  const { id } = useParams();
  const history = useHistory();
  const currentContact = contacts.find(
    (contact) => contact.id === parseInt(id)
  );

  const [name,setName]= useState("");
  const [type,setType]= useState("");
  const [code,setCode]= useState("");
  const [description,setDescription]= useState("");

  const handleSubmit = (e) => {
    e.preventDefault();

    const data = {
      id: contacts.length > 0 ? contacts[contacts.length - 1].id + 1 : 0, 
      name,
      type,
      code,
      description
    };
  }
  return (
    <div>
        <Box >

     <Grid container justifyContent={'center'}>
       <Grid item xs={12} sm={8} md={6} sx={{ marginTop: 3, boxShadow: 'rgba(0, 0, 0, 0.35) 0px 5px 15px' }}>
         <Paper
           sx={{ padding: '17px', height: 'fit-content', marginLeft: '7px' }}
         >
           <form onSubmit={handleSubmit()}>
             <Typography sx={{ fontSize: '20px' }}>Edit Account</Typography>
             <Box>
               <label>
                 <Typography mt={5} mb={1} sx={{ fontSize: "16px", color: "#BD4C46" }}>
                   Account Name
                 </Typography>
               </label>

               <input
                 type='text'
                  value={name}
                  onChange={(e) => setName(e.target.value)}

                 style={{ height: '30px', width: '250px' }}
               />
             </Box>

             <Box>
               <label>
                 <Typography mt={3} mb={1} sx={{ fontSize: "16px", }}>
                   Account Code <HelpOutlinedIcon sx={{ height: '18px', position: 'absolute', marginTop: '2px' }} />
                 </Typography>
               </label>

               <input
                 type='text'
                  value={code}
                  onChange={(e) => setCode(e.target.value)}
                 style={{ height: '30px', width: '250px' }}
               />
             </Box>

             <Box>
               <label>
                 <Typography mt={3} mb={1} sx={{ fontSize: "16px", color: "#BD4C46" }}>
                   Account Type
                 </Typography>
               </label>
               <MenuItem 
                  value={type}
                  onChange={(e) => setType(e.target.type)} 
                 style={{ height: '40px', width: '255px' }}>
               <select> <option>Stock</option>
                 <option>Customer</option></select></MenuItem>


             </Box>

             <Box>
               <label>
                 <Typography
                   mt={3}
                   mb={1}
                   sx={{ fontSize: "16px", color: "#000" }}
                 >
                   Description
                 </Typography>
               </label>

               <textarea
                 rows={3}
                 cols={25}
                 placeholder="Max 500 characters"
                  value={description}
                  onChange={(e) => setDescription( e.target.value)}
                 style={{
                   padding: "10px",
                   borderRadius: "2px",
                   border: "1px solid gray",
                   fontFamily: 'sans-serif',
                   fontSize: '15px'
                 }}
               />
             </Box>

             <Box>
               <Typography mt={3}><input type="checkbox"  ></input>
                 <label style={{ fontFamily: 'inherit', marginLeft: '5px' }}>Add to the watchlist on my dashboard</label></Typography>
             </Box>

             <Box mt={6} >
              <button style={{ height: '40px', width: '65px', backgroundColor: '#CF4B28', color: 'white', border: '1px solid #CF4B28', borderRadius: '5px', fontWeight: 'bold' }} 
                onClick={''} >Save</button>
               <Link to={'/user-list'}> <button style={{ height: '40px', width: '65px', marginLeft: '11px', backgroundColor: 'lightgrey', border: '1px solid lightgray', borderRadius: '5px' }}>Cancel</button></Link>
             </Box>



           </form>
         </Paper>
       </Grid>
     </Grid>

   </Box>
    </div>
  )
}
